const ReleaseEntry = () => (
  <div>
    <div className="ReleaseEntry-wrapper">
      <img className="josyara" src="/img/josy.jpg" alt="josyara" />
      <span className="artist-name">JOSYARA & IZEM</span>
    </div>
    {style}
  </div>
);

const style = (
  <style jsx>{`
    .ReleaseEntry-wrapper {
      position: relative;
    }
    .josyara {
      width: 100%;
    }
    .artist-name {
      position: absolute;
      bottom: 0;
      right: 1rem;
    }
  `}</style>
);

export default ReleaseEntry;
